Articles = new Mongo.Collection("articles");
Selections = new Mongo.Collection("selections");

if (Meteor.isClient) {
  Template.showArticle.helpers({
    currentArticle: function () {
      var items = Articles.find({}, {sort: {date: 1, title: 1}}).fetch();
      var counter = Selections.find({userId: Meteor.userId()}).count();
      return items.slice(counter,counter+1);

    }, 
    currentCount: function() {
      return Selections.find({userId: Meteor.userId()}).count();
    }, 
    totalCount: function() {
      return Articles.find().count();
    },
    userIsJay: function(){
      return Meteor.user().emails[0].address =="jay.greenspan@globe.com" ? true : false;
    }
  });

  Template.showArticle.events({
    'click button': function (e) {
      var isItNews  = e.currentTarget.id==="isNews" ? 1 : 0;
      var notNews = e.currentTarget.id==="isNews" ? 0 : 1;
      Selections.insert({
        userId: Meteor.userId(),
        email: Meteor.user().emails[0].address,
        articleId: this._id,
        title: this.title,
        isNews: isItNews,
        notNews: notNews,
        date: this.date,
        section: this.final_section_name,
        PVs: this.PVs,
        Visits: this.Visits
      });
    },
    'click #clearSelections': function(){
      Meteor.call("clearSelectionsdb");
    }
  });
}

